webpackJsonp([60471830647122],{548:function(n,t){n.exports={data:{site:{siteMetadata:{title:"MyBlog"}},markdownRemark:{html:'<pre><code class="language-c">void BubbleSort(uint8_t *pt, uint32_t size)\n{\n   uint32_t i,j; \n   uint8_t data,*p1,*p2;\n\n   for(i=1; i&#x3C;size; i++)\n   {\n     p1 = pt; // pointer to beginning\n     for(j=0; j&#x3C;size-i; j++)\n     {\n       p2 = p1+1; // p2 points to the element after p1\n       if(*p1 > *p2)\n       {\n         data = *p1; // swap\n         *p1 = *p2;\n         *p2 = data;\n       }\n      p1++;\n    }\n  }\n} \n\nvoid main(void)\n{\n  BubbleSort(Vbuffer,100); // Vbuffer = &#x26;VBuffer[0]\n  BubbleSort(Pbuffer,200); // Pbuffer = &#x26;PBuffer[0]\n} \n</code></pre>',frontmatter:{title:"Ordenaci√≥n de burbuja en C",author:"Maximiliano Valencia",date:"20 March, 2018"}}},pathContext:{slug:"/posts/bubble_sort_with_pointers_in_c/"}}}});
